(32, 33, 1, 'Web Development', '2023-02-06 21:00:43', '2023-02-08 22:01:11', 'cd90e169-9768-4cff-8d20-a6fed3e8affb', NULL, '<p>I specialize in user-friendly websites using Craft CMS, influencing user interactions with custom, high-performing sites for various industries.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, 34, 1, 'Web development', '2023-02-06 21:01:08', '2023-02-06 21:01:08', '898a4f3a-a8b3-41ea-9599-952d98615ea7', NULL, '<p>My area of expertise is crafting custom, high-performing websites for various industries using Craft CMS. This platform offers a unique combination of power and flexibility, and provides a user-friendly experience for both developers and content managers.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(34, 35, 1, 'UI Design', '2023-02-06 21:01:12', '2023-02-08 22:01:05', 'a85c6516-fc2d-4001-9cf3-2e150530603d', NULL, '<p>I specialize in designing user-friendly digital experiences that satisfy both user and business needs. My expertise influences user interactions with your website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(35, 36, 1, 'UI/UX design', '2023-02-06 21:01:33', '2023-02-06 21:01:33', '76b27fd1-3e31-4592-a24d-62053b6ed26f', NULL, '<p>I specialise in designing digital experiences that are both engaging and user-friendly for businesses. By blending research, strategy, and design, I provide tailored solutions that satisfy both user and business requirements.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(36, 37, 1, 'Content Strategy', '2023-02-06 21:01:44', '2023-02-08 22:02:00', '7bc37690-8df6-4ee2-ad35-78c4660b187c', NULL, '<p>I specialize in custom content strategy, maximizing reach and engagement for businesses through audience, goal, and challenge understanding</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(37, 38, 1, 'Content strategy', '2023-02-06 21:02:00', '2023-02-06 21:02:00', '7c7dda60-8c5e-4c2a-a9e7-5f42c86c6b55', NULL, '<p>I help businesses to understand your target audience, goals, and challenges, and creates a custom content strategy that supports your business objectives. I develop a plan that maximises reach and engagement</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(38, 39, 1, 'Commerce', '2023-02-06 21:02:03', '2023-02-08 21:59:47', '6156c1cb-68b7-43d0-8a00-904ab2c79e40', NULL, '<p>I specialize in user-friendly e-commerce using Craft Commerce, offering custom, high-performing sites and end-to-end solutions for businesses in various industries.\"</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(39, 40, 1, 'Commerce', '2023-02-06 21:02:36', '2023-02-06 21:02:36', 'eeb163ff-69ea-4ed8-85be-835bbd7b5e25', NULL, '<p>I work with businesses to succeed in the digital marketplace, providing end-to-end solutions that include design, development, and digital marketing. Using Craft Commerce ensure that your e-commerce platform is user-friendly, secure, and optimised for conversions.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(40, 41, 1, 'Content Planning', '2023-02-06 21:02:41', '2023-02-08 22:00:39', 'ff95fb42-74d9-47a3-98bd-c47a5e54df93', NULL, '<p>I specialize in content planning and organization for maximum impact and efficiency, influencing business success through the development of a comprehensive content plan.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(41, 42, 1, 'Content Planning', '2023-02-06 21:02:59', '2023-02-06 21:02:59', '41129d7c-c90a-4880-9a68-3faf4361804b', NULL, '<p>I help businesses plan and organise their content for maximum impact and efficiency. Working with you to develop a content calendar, identify key themes and topics, and create a plan for producing, publishing, and promoting your content.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(42, 43, 1, 'Branding', '2023-02-06 21:03:03', '2023-02-08 22:02:42', '477532a1-5c35-497b-9d31-21056a6b18c6', NULL, '<p>I specialize in creating a strong brand identity that influences user interactions and differentiates businesses from competitors.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(43, 44, 1, 'Branding', '2023-02-06 21:03:15', '2023-02-06 21:03:15', 'ecbd9ab2-c9e2-483a-b76c-75545a4661b2', NULL, '<p>I help businesses establish a strong and consistent brand identity. From logo design and typography to colour palettes and brand voice, we work with you to develop a comprehensive brand strategy that differentiates you from the competition.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
